const learningOutcomes = [
    {
        day: "Day 1",
        outcome: "Learned the basics of HTML and how to structure a webpage."
    },
    {
        day: "Day 2",
        outcome: "Explored CSS for styling and layout design."
    },
    {
        day: "Day 3",
        outcome: "Introduced to JavaScript and its role in web development."
    },
    {
        day: "Day 4",
        outcome: "Started learning about React and component-based architecture."
    },
    {
        day: "Day 5",
        outcome: "Built a simple React application and understood state management."
    }
];

export default learningOutcomes;
